		"text": "“훈련병, 정신 안 차리나!” 美 ‘버럭 신병교육’ 퇴출\nhttps://t.co/iUVlJFL95U\n\n❝ 교관이 훈련병 면전에 험악한 얼굴로 버럭 소리를 질러 군기를 들이는 훈육 방식을 미 육군에서는 ‘샤크 어택(shark attack)’이라고 부르며 오랜 전통으로 여겨왔다. 이 ‘샤크 어택’이 사라지게 됐다.\n\n#minfav"
