		"text": "In the middle of this crisis, Zuck went on a 6-week “walk-about” in Asia. He hadn’t taken a break since starting FB 4 years earlier and working 100 hrs/wk, exhausted and needed to clear his head. Sheryl had recently joined and he trusted her to keep things together in his absence"
